def lev(s, t):
    rows = len(s)+1
    cols = len(t)+1
    distance = np.zeros((rows,cols),dtype = int)
    for i in range(1, rows):
        for k in range(1,cols):
            distance[i][0] = i
            distance[0][k] = k
    for col in range(1, cols):
        for row in range(1, rows):
            if s[row-1] == t[col-1]:
                cost = 0
            else:
                cost = 2
            distance[row][col] = min(distance[row-1][col] + 1,
                                 distance[row][col-1] + 1,
                                 distance[row-1][col-1] + cost)
    Ratio = ((len(s)+len(t)) - distance[row][col]) / (len(s)+len(t))
    return Ratio


def call(url, keys, num):
    response = requests.request("GET", url, headers=keys, params={'page':num})
    return response

def genpairs():
    for i in range(1, 145):
        for j in (call(ccstack, headers, i).json())['results']:
            card_list.append(j['title'])
            card_keys[j['title']] = [i, j]

def fuzzy_locate(targ):
    curr = 0
    max = ''
    for i in card_list:
        if lev(targ, i) > curr:
            curr = lev(targ, i)
            max = i
    return max

def getBenefits():
    response = call(ccstack, headers, 1).json()['results']['rewards']
    return response

